const NotesList = () => {
    return (
        <div>
            <table>
                <thead>
                    <th>S.No</th>
                    <th>Name</th>
                    <th>Actions</th>
                </thead>
                <tbody>
                    <tr>
                        <td>S</td>
                    </tr>

                </tbody>
            </table>
        </div>
    );
}

export default NotesList;
